import React, {useState} from 'react'

function ConsonantForm(props) {
    const [formData, setFormData] = useState({
        symbol: "test 1"
    })
    

    return (
        <form>
            <div>
                <label>Phonetic Symbol</label>
                <input type="text" value={formData.symbol}/>
            </div>
        </form>
    );
}


export default ConsonantForm;
